@czzp Buenos Aires, 2019.

¡Quiero compartirles la buena noticia de que somos ganadores!

@hiphopcinefest_org nos ha premiado con la mención "Public Award" como la propuesta más votada por la audiencia durante la edición 2023 celebrada en Roma, Italia. Felicitar y dar gracias por su visión, compromiso y confianza en el proyecto a mi hermano @tutorodriguez y su invaluable aporte y dedicación al Cine Venezolano; a todo nuestro hermoso equipo de realizadores que hicieron realidad 'EL GOLPE', a la organización del festival por reconocer nuestro trabajo y por supuesto a c/u de ustedes por dedicarle unos minutos de su valioso tiempo a apreciar, valorar y calificar nuestra obra, son parte de nuestra alegría en estos momentos y lo agradecemos infinitamente. 

Hecho en Venezuela.

